// DecorSection.vue
<template>
  <div class="decor-section">
    <h2>Decor</h2>
    <p>{{ decor.description }}</p>
    <p>Color Scheme: {{ decor.colorScheme }}</p>
    <p>Flowers: {{ decor.flowers }}</p>
  </div>
</template>

<script>
export default {
  data() {
    return {
      decor: {
        description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce sit amet sapien eget urna rhoncus lobortis sed vel mauris.',
        colorScheme: 'White and Gold',
        flowers: 'Roses and Lilies'
      }
    }
  }
}
</script>

<style>
/* Customize Bootstrap styles */
.decor-section {
  background-color: #f8f9fa;
  border: 1px solid #ddd;
  padding: 30px;
}
</style>
